import React from 'react';
import {Gitgraph} from '@gitgraph/react';
import {createFixedHashGenerator} from './helpers';

export function ResumeGraphComponent() {
    return (
        <Gitgraph options={{
            author: 'CS <Bachelors@JNTU.in>',
            generateCommitHash: createFixedHashGenerator()
        }}>
            {(gitgraph) => {
                // Simulate git commands with Gitgraph API.
                const master = gitgraph.branch("master");
                master.commit("Initial commit");

                const edu = gitgraph.branch("Education");
                edu.commit("Mathematics, Algorithms, Datastructures");
                edu.commit("Database Systems, Programming, System Architecture, Networking");
                edu.commit("Information systems, Computation & Automata");
                master.merge(edu);

                const aFeature = gitgraph.branch("a-feature");
                aFeature
                    .commit("Make it work")
                    .commit("Make it right")
                    .commit("Make it fast");

                edu.merge().tag("Prepare v1");

                master.merge().tag("v1.0.0");
            }}
        </Gitgraph>
    );
}
